import { Button, Flowbite } from 'flowbite-react';
import React from 'react';

const customTheme = {
    color: {
        blackGray: '#11242e',
    },
};


export default function CustomBtn({color}) {
    return <Button theme={customTheme} color={color}>Đăng nhập</Button>;
}
